import React, { Component } from 'react';
import './Resume.css';

class Resume extends Component {



  render() {
      var goGators = {color: 'RoyalBlue'};

      var courses_formatted = this.props.relevant_courses.map(function(course){
        return <li>{course.title} <b>course.lang</b></li>;
      })

    return (
      <div className="res-wrapper">
        <div className="res-block">
            <h1>Resume</h1>
            <h3>Education</h3>
            {this.props.year} Year Computer Science Student at the <span style={goGators}> University of Florida</span>
            <h3>Relevant Coursework</h3>
            <ul>
                {courses_formatted}
            </ul>
            <h3>Experience</h3>
            <ul>
                <li>Undergraduate TA <b>Java + C++</b></li>
                <li>Ultimate Software SWE Intern <b>Summer 2019</b></li>
                {/* <li>Data Structures and Algorithms</li>
                <li>Intro to Computer Organization</li> 
                <li>Elementary Differential Equations</li>
                <li>Applications of Discrete Structures</li>
                <li>Programming Fundamentals 1-2</li> */}
            </ul>
            <h3>Involvement</h3>
            <ul>
                <li>Association of Computer Engineers (ACE) Member</li>
                <li>ACM Software Engineering Team</li>
                <li>Harn Museum of Art M.U.S.E.</li>
                <li>Theatre Strike Force</li>

            </ul>
            <h3>Projects</h3>
            <ul>
                <li>Petree's Prints <b>MERN STACK</b></li>
                <li>Bachelor Twitter Analysis <b>PYTHON + TWEEPY</b> + (eventually) <b>BEAUTIFULSOUP</b></li>
                <li>this <b>HTML, CSS, REACT </b> </li>
                <li>Galaga <b>PROCESSING</b></li>

            </ul>
        </div>


      </div>
    );
  }


}



 export default Resume;
